import React from 'react';
import './style.css';

const Header = () => {
  return (
    <nav>
      <div>
        <h1>Karla Ferreira</h1>
      </div>
      <ul>
        <li><a href="../hero">Home</a></li>
        <li><a href="#">Sobre</a></li>
        <li><a href="#">Habilidades</a></li>
        <li><a href="#">Projetos</a></li>
        <li><a href="#o">Contato</a></li>
      </ul>
    </nav>
  );
}

export default Header;
